function getCode(letter) {
    var ret = [],
        charCodeString = "" + letter.charCodeAt(0).toString(16);

    if(!isNaN(+charCodeString)) {
        ret.push(`[${toShifts(+charCodeString)}]`);
    } else {
        for(var i = 0; i < charCodeString.length; i++) {
            if(isNaN(+charCodeString[i])) {
                ret.push(`[${alphabet[charCodeString[i]]}]`);
            } else {
                ret.push(`[${toShifts(+charCodeString[i])}]`);
            }
        }
    }

    return ret.join("+");
}

function toShifts(num, s) {
    var numString = "" + num,
        switchRet = "",
        digitRet = "",
        ret = [];

    if(s || s == undefined || numString.length == 1) {
        switch(num) {
            case 0:
                switchRet = "+![]";
                break;
            case 1:
                switchRet = "+!+[]";
                break;
            case 2:
                switchRet = "!+[]+!+[]";
                break;
            case 3:
                switchRet = "!+[]+!+[]+!+[]";
                break;
            default:
                var n = 1;
                while((2 << (n + 1)) <= num) n++;
                var remainder = num - (2 << n);
                ret = [`((${toShifts(2, true)})<<(${toShifts(n, true)}))`];
                if(remainder > 0) ret.push(`(${toShifts(num - (2 << n), true)})`);
                switchRet = ret.join("+");
                break;
        }
    }

    if(!s || s == undefined) {
        if(numString.length >= 2) {
            ret = [];
            for(var i = 0; i < numString.length; i++) ret.push(`[${toShifts(+numString[i], false)}]`);
            digitRet = ret.join("+");
        }
    }

    return (s == undefined) ? (((switchRet.length < digitRet.length) || digitRet == "") ? switchRet : digitRet) : ((s || numString.length == 1) ? switchRet : digitRet);
}

function makeFunction(code) {
        return `[][${convert("filter")}][${convert("constructor")}](${convert(code)})`;
}

